script: |
  super -f text -I q10461.spq | sort > q10461.out

inputs:
  - name: q10461.spq
    data: |
      SELECT DISTINCT - col0 FROM tab1 (FORMAT parquet) WHERE ( NOT - col2 IN ( col0 * - 11, col2, - - col0 + col1 + + + 17, + 37 ) );
  - name: tab1

outputs:
  - name: q10461.out
    data: |
      -51
      -85
      -91
